var MoteioReceiver = function() {

  var self = this;

  self.remote_location = 'http://lvh.me:3000';
  // prod self.remote_location = 'http://mote.io:80';

  self.channel = null;

  self.params = {};
  self.debug = true;

  self.inputDisplay = function(icon, color) {

    var
      color = color || null,
      popup = $('<span class="icon-' + icon + '"></span>')

    if(color) {
      popup.css('color', color);
     }

    container = $('<div class="input-display"></div>');

    container.append(popup);
    $('body').append(container)

  }

  // Press a button.
  // var button = which button# was pressed
  // var down = event phase? down/up?
  self.triggerInput = function(data) {

    console.log(data)

    var toCall = null,
    buttonFunct = self.params.blocks[data.block_id].data[data._id] || null;

    console.log(self.params)

    if(!buttonFunct){
      if(buttonFunct.press){
        self.clog('button #' + button + ' has no methods set for button.data().', 3);
      }
    } else {

      if (data.press) {
        toCall = buttonFunct.press;
      } else {
        toCall = buttonFunct.release;
      }

      toCall = toCall || null;

      if(toCall){
        toCall();
      } else {
        if (data.press){
          self.clog('No method set for press() input on button', 2);
        } else {
          self.clog('No method set for release() input on button', 2);
        }
      }

    }

  };

  // Trigger a click on whatever page is being controlled.
  // var elementId = element on the page to click
  self.simulateClick = function(elementId) {
    var evt = document.createEvent('MouseEvents');
    evt.initMouseEvent('click', true, false,  document, 0, 0, 0, 0, 0, false, false, false, false, 0, null);
    document.getElementById(elementId).dispatchEvent(evt);
  };

  // Fancy console logs
  self.clog = function(description, level) {

    var level = level || 1;
    if (self.debug && console && console.log) {
      var message  = [];
      message.push('[mote.io]');
      switch (level){
      case 3:
        message.push('Error:');
        message.push(description);
        console.error(message.join(' '));
        break;
      case 2:
        message.push('Warning: ');
        message.push(description);
        console.warn(message.join(' '));
        break;
      default:
        message.push('Notice: ');
        message.push(description);
        console.log(message.join(' '));
        break;
      }
    }

  };

  self.goHome = function() {
    window.location = self.remote_location + "/homebase";
  }

  // Listen to channel uid
  self.listen = function(roomName) {

    console.log('trying to listen')
    self.channel = io.connect(self.remote_location + '/' + roomName, {'force new connection':true});
    // https://github.com/LearnBoost/socket.io-client/issues/251

    self.channel.on('connect', function () {

      self.clog('connected');
      self.clog('listening to channel ' + roomName);

      console.log('!!! EMIT ACTIVATE');
      self.channel.emit('activate', function(){
        console.log('got response')
      });
      self.channel.emit('update-config', self.params);

      self.channel.emit('start', null, function (key) {
        self.clog('started');
        self.clog(key);
      });

    });

    self.channel.on('get-config', function(data, holla){
      self.channel.emit('update-config', self.params);
    });

    self.channel.on('go-home', function(){
      self.goHome();
    });

    self.channel.on('input', function (data) {
      console.log(data);
      self.triggerInput(data);
    });

    self.channel.on('select', function (data) {
      console.log(data);
      console.log(self.params.selects[data.id])
      self.params.selects[data.id].options[data.value].action();
    });

    self.channel.on('search', function (data) {
      console.log('made it')
      console.log('data')
      console.log(self.params.search)
      self.params.search.action(data.value);
    });

    self.channel.on('deactivate', function () {
        self.clog('got deactivate')
        self.stop();
    });

  };

  // Notify the server of stuff.
  self.notify = function(line1, line2, image) {

    // self.clog('notify')
    data = {
      line1: line1,
      line2: line2,
      image: image
    }
    self.channel.emit('notify', data, function(){
      // self.clog('cb');
    });

  };

  self.updateButton = function(id, icon, color) {

    // self.clog('update button')
    data = {
      id: id,
      icon: icon,
      color: color
    }

    self.channel.emit('update-button', data, function(){
      // self.clog('cbb');
    })

  }

  self.stop = function () {
    if (self.channel) {
      console.log('connected to a channel, disconnecting, ');
      self.channel.disconnect();
      self.channel = null;
    } else {
      console.log('not connected to any channels yet');
    }
  };

  self.start = function () {
    console.log('!!! STARTING UP');
    $.ajax({
      type: 'get',
      url: self.remote_location + '/get/login/',
      dataType: 'jsonp',
      success: function(data) {
        console.log('got login response')
        if(data.valid) {
          self.listen(data.user._id);
        } else {
          alert('Mote.io is not logged in to any account. Please log in at http://mote.io/login.');
        }
      }
    });
  }

  self.init = function(params) {

    $(document).ready(function() {

      self.start();

      $(window).on("focus", function() {

        console.log('!!!!!!! FOCUS')

        // activate this channel if it's not already active
        if (!self.channel) {
          console.log('STARTING')
          self.start();
          // this will set is_active
        } else {
          //console.log('CHANNEL EXISTS, DONT START')
        }

      });

      self.params = params;

    });

  };

};
var rec = new MoteioReceiver();
rec.init(window.moteio_config)

